function filtersChange(e){$.ajax({url:"/shipper/status/",data:{shipper_id:$("#shipper").val()},success:t=>{const r=e.find("tbody");r.empty();let d=0,a=0,o=0,s=0,i=0;for(var p in t.shipperAvg){let e=t.shipperAvg[p],d="black";e.percentage<100&&(d="red"),e.avg>0&&r.append(`<tr><td>${e.name}</td><td>${msToTime(60*e.avg*1e3,!1)}</td><td>${msToTime(60*e.loadTime*1e3,!1)}</td><td data-toggle="tooltip" data-html="true" title="${e.active_drivers}/${e.trucks_required??"N/A"}" style="color: ${d}">${e.percentage>0?e.percentage+"%":"N/A"}</td></tr>`),o+=e.avg,s+=parseInt(e.percentage),i++}0!==i&&(d=o/i,a=Math.round(s/i));let l="black";a<100&&(l="red"),r.append(`<tr style="border-top:3px solid #d9d9d9"><td>Total</td><td>${msToTime(60*d*1e3,!1)}</td><td>${msToTime(60*t.LoadTimeAvg*1e3,!1)}</td><td style="color: ${l}">${a}%</td></tr>`)},error:()=>{throwErrorMsg()}})}filtersChange($("#customerTable"));
